import { Component } from "react";
import Home from "../pages/home";
import {  
    BrowserRouter as Router,  
    Routes,  
    Route,  
    Link  
}   
from 'react-router-dom';  

class Layout extends Component{

    constructor(props){
        super(props)
    }

    render(){
        return(
            <Router>

                    <Routes>
                        <Route path={'/'} element={Home} />
                    </Routes>

            </Router>
        )
    }
}

export default Layout
